import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import About from './pages/about.jsx';
import Posts from './pages/posts.jsx';

import './style/style.css'


function App() {

  return (

    <Router>
      <Routes>
        <Route path='/posts'>
          <Posts></Posts> 
        </Route>
      </Routes>
    </Router>

  );
}

export default App;
